Menindaklanjuti  laporan warga  melalui medsos Bapak Wali Kota terkait pembangunan Balai Warga RW 07 Kelurahan Mustikasari

WAKTU PELAKSANAAN :
Hari :  Rabu
Tanggal :  17 September  2025.
Waktu : 14.00 WIB s/d selesai.

TEMPAT :
Balai warga RW 07 Kelurahan Mustikasari

HADIR: 
‚Ä¢	Sub Koordinator Bidang Perkim Disperkimtan (Setia Budi, S.Ap, M.Si)
‚Ä¢	Sekel Kelurahan Mustikasari (Retno Wijayanti, ST, MSi
‚Ä¢	Kasi Permasbang Kelurahan Mustikasari (Andarinyo, S.E)
‚Ä¢	Pelaksana Perkim (Tuvli, ST & Fajar, S.E)
‚Ä¢	Pelaksana Kelurahan (Rudi Cahyadi, S.E)
‚Ä¢	Pelapor, Ketua RT 06/ RW 07 (Bapak Hotma)
‚Ä¢	Pengurus RT dan RW 07 

Adapun hasil penelusuran di lapangan terkait laporan:
1.	Dari Kelurahan Mustikasari mendampingi pihak Disperkimtan menemui pelapor, Ketua RT 06/RW 07 terkait pembangunan Balai Warga RW 07 yang berada di lingkungan RT 06/ RW.
2.	Balai Warga RW 07 sudah lama belum mendapatkan renovasi setelah dibangun 5 tahun yang lalu, baik balai warga maupun lapangan di depan balai warga sehingga Ketua RT melalui medsos Bapak Wali Kota memyampaikan keinginan agar Balai Warga RW 07 dapat direnovasi. Dari pihak RT menyampaikan balai warga agar diberi dinding sehingga tidak kehujanan dan kepanasan, dan dikeramik serta lapangan diperbaiki.
3.	Dari Disperkimtan menerangkan bahwa renovasi balai warga akan dimasukkan ke anggaran ABT tahun 2026, karena tahun ini sudah selesai penganggarannya di SIPD.

